    return(
        <div>
            <br/>
            <input type="text" placeholder="Enter something...!"/>
            <br/><br/>
            <input type="password" placeholder="password"/>
            <br></br>
            <button>Singhup</button>
            <button>Login</button>
            <button>LogOut</button>
            
        </div>
    )
}
